INSERT INTO `idazlea` (`kodea`, `izena`, `jaioterria`, `biografia`, `argazkia`) VALUES
(1, 'JOSEBA SARRIONANDIA', 'IURRETA', 'Joseba Sarrionandia Uribelarrea (Iurreta, Bizkaia, 1958ko apirilaren 13a) euskal idazlea da. Olerki eta narrazio laburren hainbat liburu idatzi ditu, baita eleberri batzuk ere. 1985ean kartzelatik ihes egin zuen, eta ordutik aurrera 31 urtez ezkutuan bizi izan zen. Erbestetik idazten eta zabaltzen zituen bere lanak, izenik gabeko ezlekuetatik, eta kartzelatik alde egin baino hilabete lehenagoko zuri-beltzeko argazki bat izan zen haren irudi identifikagarri bakanetakoa. 2016ko azaroaren hasieran, Etxepare Euskal Institutuak Habanako Unibertsitatean (Kuba) euskal irakurle izendatu zuen Sarrionandia, eta orduantxe jakin zen Habanan bizi dela duela urte batzuetatik. Handik egun gutxira, azaroaren 20an, 31 urtean lehen aldiz, haren argazki eguneratu bat argitaratu zen, Euskal Herriko lau agerkaritan (ZuZeu, Berria, Gara eta Noticias taldea) batera plazaratutako elkarrizketa batean.', );
